import React from 'react'

const Filmlist = (props) => {
    console.log(props)
    let m = props.mov.map((item,index) => {
        return <h3>{props.mov[index].title}</h3>
    })
    return (
        <div className="film-list">
        <h1 className="section-title">FILMS</h1>
        {/* {m} */}
        </div>
    )
}

export default Filmlist
